// src/pages/workers/WorkersList.jsx
import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import axios from "axios";
import { jwtDecode } from "jwt-decode";
import WorkerForm from "./WorkerForm"; // Doğru dosya yolunu kullandık

function WorkersList() {
    const [workers, setWorkers] = useState([]);
    const [editingWorker, setEditingWorker] = useState(null); // Düzenlenen çalışan
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState("");
    const navigate = useNavigate();

    const token = localStorage.getItem("token");

    // Çalışanları çeken fonksiyon
    const fetchWorkers = async () => {
        try {
            const response = await axios.get("http://localhost:8080/api/worker/list", {
                headers: { Authorization: `Bearer ${token}` },
            });
            setWorkers(response.data);
        } catch (err) {
            setError("Çalışanlar alınamadı.");
        } finally {
            setLoading(false);
        }
    };

    // Bileşen yüklendiğinde ve token değiştiğinde çalışır
    useEffect(() => {
        if (!token) {
            navigate("/login");
            return;
        }

        try {
            const decodedToken = jwtDecode(token);
            const roles = decodedToken.roles || [];
            const authorized = roles.some((r) => r === "PROJE_YONETICISI");
            if (!authorized) {
                setError("Yetkiniz yok.");
                setLoading(false);
                return;
            }
            fetchWorkers();
        } catch (err) {
            setError("Geçersiz token.");
            localStorage.clear();
            navigate("/login");
        }
    }, [token, navigate]);

    // WorkerForm'dan gelen veriyi işleyen fonksiyon
    const handleSubmit = async (workerData) => {
        try {
            if (workerData.id) {
                // Güncelleme işlemi
                await axios.put(`http://localhost:8080/api/worker/update/${workerData.id}`, workerData, {
                    headers: { Authorization: `Bearer ${token}` },
                });
                alert('Çalışan başarıyla güncellendi!');
            } else {
                // Ekleme işlemi
                await axios.post("http://localhost:8080/api/worker/create", workerData, {
                    headers: { Authorization: `Bearer ${token}` },
                });
                alert('Çalışan başarıyla eklendi!');
            }
            fetchWorkers();
            setEditingWorker(null);
        } catch (err) {
            console.error(err);
            alert('İşlem başarısız oldu.');
        }
    };

    // Silme işlemi
    const handleDelete = async (workerId) => {
        if (!window.confirm("Bu çalışanı silmek istediğinize emin misiniz?")) {
            return;
        }
        try {
            await axios.delete(`http://localhost:8080/api/worker/${workerId}`, {
                headers: { Authorization: `Bearer ${token}` },
            });
            alert('Çalışan başarıyla silindi!');
            fetchWorkers();
            setEditingWorker(null);
        } catch (err) {
            console.error(err);
            alert('Silme işlemi başarısız oldu.');
        }
    };

    if (loading) return <div>Yükleniyor...</div>;
    if (error) return <div style={{ color: "red" }}>{error}</div>;

    return (
        <div>
            <h1>Çalışan Yönetimi</h1>

            {/* Yeni çalışan ekleme formu */}
            {!editingWorker && (
                <div>
                    <h2>Yeni Çalışan Ekle</h2>
                    <WorkerForm onSubmit={handleSubmit} />
                </div>
            )}

            {/* Düzenleme formu (sadece bir çalışan seçiliyken görünür) */}
            {editingWorker && (
                <div>
                    <h2>Çalışan Düzenle</h2>
                    <WorkerForm
                        initialData={editingWorker}
                        onSubmit={handleSubmit}
                        onCancel={() => setEditingWorker(null)}
                        onDelete={handleDelete}
                    />
                </div>
            )}

            <hr />

            <h2>Çalışan Listesi</h2>
            <ul>
                {workers.map((worker) => (
                    <li key={worker.worker_id}>
                        {worker.name} ({worker.age}, {worker.gender})
                        <button onClick={() => setEditingWorker(worker)} style={{ marginLeft: "10px" }}>Düzenle</button>
                    </li>
                ))}
            </ul>
        </div>
    );
}

export default WorkersList;
